import React,{useState} from 'react'
import ItemsJson from './television.json'
import Search from './components/Search'

export const Items =()=>{

    console.log(ItemsJson)

    const itemsJson=ItemsJson

    return(
        <>
            <Search itemsJson={itemsJson}/>
            {itemsJson.map((item, id)=>{
                return(
                    <div key={id}>
                    <img src={item.image.medium}/>
                    <p>{item.name}</p>
                    <a href={item.url}>詳細へ</a>
                    <a href={item.review.url}>レビューを見る</a>
                    </div>
                )
            })}
        </>
    )
}
